import { AddPage } from "components/pages/AddPage";
import { SearchPage } from "components/pages/SearchPage";
import React from "react";
import { CurrentTabType } from "store/atoms/currentTabState";

export const ALL_TABS: {tabId: CurrentTabType, page: React.ReactNode, tabName: string, }[] = [
  {
    tabId: 'search',
    tabName: 'Search',
    page: <SearchPage />,
  },
  {
    tabId: 'add',
    tabName: 'Add',
    page: <AddPage />,
  },
  {
    tabId: 'settings',
    tabName: 'Settings',
    page: <SearchPage />,
  },
  {
    tabId: 'about',
    tabName: 'About',
    page: <SearchPage />,
  },
]
